`,c.jsx(i.p,{children:"Debugging tip: when you see impossible jumps, check for duplicate inclusion across adjacent dates and late-arriving data reprocessed into the wrong day."}),`
`,c.jsx(i.h2,{children:"Precision is a product requirement"}),`
`,c.jsx(i.p,{children:"This is one of the biggest differences from recommendation systems."}),`
`,c.jsx(i.p,{children:"If a recommender suggests the wrong product or article, it is usually wrong, but fine."}),`
`,c.jsx(i.p,{children:"Asset/statistics systems are different:"}),`
`,c.jsxs(i.ul,{children:[`
`,c.jsx(i.li,{children:"if you are off by even a few cents, users will get upset"}),`
`,c.jsx(i.li,{children:"decimal handling is a constant source of pain"}),`
`]}),`
`,c.jsx(i.p,{children:"For some high-net-worth users, converting total assets into another currency is extremely sensitive. Even if your FX rate is precise to 4 decimal places, the implied exchange difference can still be tens of thousands."}),`
`,c.jsx(i.p,{children:"Treat rounding, precision, and FX conversion rules as part of the product contract:"}),`
