`,c.jsx(i.li,{children:"least privilege"}),`
`,c.jsx(i.li,{children:"scoped, time-boxed access tied to a ticket"}),`
`,c.jsx(i.li,{children:"audit logs (who accessed what, when, why)"}),`
`,c.jsx(i.li,{children:"masking where possible"}),`
`]}),`
`,c.jsx(i.h2,{children:"Avoid one-off code workarounds; prefer data patches"}),`
`,c.jsx(i.p,{children:"An easy trap is:"}),`
`,c.jsxs(i.blockquote,{children:[`
`,c.jsxs(i.p,{children:["Only one row is wrong, so add an ",c.jsx(i.code,{children:"if"})," in the pipeline to special-case it."]}),`
