`,c.jsxs(i.ul,{children:[`
`,c.jsx(i.li,{children:"slower hot path (extra checks for everyone)"}),`
`,c.jsx(i.li,{children:"unmaintainable hard-coded logic that nobody dares to delete"}),`
`,c.jsx(i.li,{children:"forces logic out of set-based tools (SQL/batch)"}),`
