`,c.jsxs(i.li,{children:["apply a targeted patch (e.g., SQL ",c.jsx(i.code,{children:"UPDATE"}),") with clear scope, audit trail, and rollback"]}),`
`]}),`
`,c.jsx(i.p,{children:"Boundary condition: if the upstream source repeatedly produces the same pattern, treat it as a system issue (contract fixes, validation, quarantining), not an endless sequence of one-offs."}),`
`,c.jsx(i.h2,{children:"The fix-layer trap"}),`
`,c.jsx(i.p,{children:"When upstream systems are messy, teams often introduce a fix layer: a dedicated layer of hard-coded rules to patch known bad records or patterns."}),`
`,c.jsx(i.p,{children:"This can be an effective short-term stabilizer (fewer incidents, fewer broken metrics), but it is dangerous long-term:"}),`
`,c.jsxs(i.ul,{children:[`
`,c.jsx(i.li,{children:"hard to understand"}),`
`,c.jsx(i.li,{children:"risky to modify (do not touch)"}),`
`,c.jsx(i.li,{children:"becomes a hidden contract that upstream systems start relying on"}),`
