`,c.jsxs(i.p,{children:["If a computed metric is wrong but it is produced through hundreds (or thousands) of lines of transformation code, humans do not scale by mentally simulating the pipeline. Instead, use the model to generate a ",c.jsx(i.strong,{children:"hypothesis shortlist"})," plus an ",c.jsx(i.strong,{children:"instrumentation plan"}),"."]}),`
